import { BrowserRouter as Router, Route, Routes, useNavigate, useLocation } from 'react-router-dom';
import './App.css';


//Components
import DemographicForm from './components/demographic_form.js';


// Main App Component
function App() {

  return (
    <div className="App">
      <h1>Phishing Evaluation Game</h1>
      <br>
      </br>
      <br>
      </br>
      <br>
      </br>
        <Router>
          <div>
            <Routes>
              <Route path="/demographicform" element={<DemographicForm />} />
            </Routes>
          </div>
        </Router>
    </div>
  );
}


export default App;
